import React, { useState, useEffect } from "react";

const Test = () => {
	const [state, setState] = useState("hello");

	useEffect(() => {
		console.log(123);
		return () => {
			console.log("unmoutn");
		};
	}, []);

	return (
		<button
			onClick={() => {
				setState("123");
			}}
		>
			{state}
		</button>
	);
};

export default Test;
